import './Content.css';

function Content(){
    return(<>
        <section className="container">
            <div className="img-container">
                <img src="./myImg.jpg" alt="Image"/>
            </div>
            <div className="content-container">            
                <h1><span>Marc Albert</span><span className="spancolor"> Bautista</span></h1>
                <p>Your aspirant Full-Stack Developer</p>
            </div>
        </section>
        <section className="container2">

        </section>
        </>
    );
}

export default Content;
